import React, { useEffect, useState } from 'react';

function Dashboard() {
  const [audits, setAudits] = useState([]);

  useEffect(() => {
    const fetchAudits = async () => {
      try {
        const response = await fetch('https://api.example.com/audits');
        const data = await response.json();
        setAudits(data);
      } catch (error) {
        console.error('Error fetching audits:', error);
      }
    };
    fetchAudits();
  }, []);

  return (
    <div>
      <h2 className="text-2xl mb-4">Audit Results</h2>
      <table className="min-w-full bg-white">
        <thead>
          <tr>
            <th className="py-2 px-4 border">ID</th>
            <th className="py-2 px-4 border">Status</th>
            <th className="py-2 px-4 border">Date</th>
          </tr>
        </thead>
        <tbody>
          {audits.map((audit, index) => (
            <tr key={index}>
              <td className="py-2 px-4 border">{audit.id}</td>
              <td className="py-2 px-4 border">{audit.status}</td>
              <td className="py-2 px-4 border">{audit.date}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Dashboard;
